import React from 'react';
import Stack from '@mui/material/Stack';
import ButtonGroup from './ButtonGroup';
import Searchbar from './Searchbar';
import SlideList from './SlideList';

const SideBar = ({ onClick, onSlideOpen }) => {

    const handleRefresh = () => {
        console.log('Slides Updated');
    };

    return (
        <div style={{ display: 'inline-block', height: '570px', width: '350px', padding: 10, border: '1px solid gray' }}>
            <Stack>
              <ButtonGroup onComplete={handleRefresh} />
              <Searchbar />
              <SlideList onClick={onClick} onSlideOpen={onSlideOpen} onComplete={handleRefresh} />
            </Stack>
        </div>
    );
};

export default SideBar;
